import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import TutorialService from "../service/TutorialService";

function TutorialListComponent() {
    const [tutorials, setTutorials] = useState([]);
    const [inputValue, setInputValue] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        fetchData();
    }, []);

    async function fetchData() {
        try {
            const data = await TutorialService.getAll();
            setTutorials(data);
        } catch (error) {
            console.log(error);
        }
    }

    function handleInputSearchChange(event) {
        setInputValue(event.target.value);
    }

    function handleEditClick(id) {
        navigate(`/tutorials/${id}`);
    }

    return (
        <div className="wrapper">
            <div className="search-bar md-3" style={{ display: "flex", marginTop: "8px" }}>
                <input
                    id="searchInput"
                    type="text"
                    className="form-control"
                    aria-label="Search by title"
                    placeholder="Search by title..."
                    value={inputValue}
                    onChange={handleInputSearchChange}
                />
                <button id="searchButton" type="button" className="btn btn-primary" style={{ marginLeft: "10px" }}>
                    Search
                </button>
            </div>
            <div style={{ marginTop: "30px" }} className="content">
                <div className="mainContent">
                    <h2>Tutorials List</h2>
                    <table className="table table-hover">
                        <thead>
                        <tr>
                            <th>Title</th>
                            <th>Description</th>
                            <th>Actions</th>
                        </tr>
                        </thead>
                        <tbody>
                        {tutorials.map(tutorial => (
                            <tr key={tutorial.id}>
                                <td>{tutorial.title}</td>
                                <td>{tutorial.description}</td>
                                <td>
                                    <button
                                        className="btn btn-warning"
                                        onClick={() => handleEditClick(tutorial.id)}
                                    >
                                        Edit
                                    </button>
                                </td>
                            </tr>
                        ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
}

export default TutorialListComponent;
